function load_comp(){

var comp=new Array();
comp[0]=new Option("Pick Comparison...","0");
comp[1]=new Option("AsPC1 cell lines vs other pancreatic cancer cell lines","AsPC1");
comp[2]=new Option("HuPT4 cell lines vs other pancreatic cancer cell lines","HuPT4");
comp[3]=new Option("MiaPaCa2 cell lines vs other pancreatic cancer cell lines","MIA");
comp[4]=new Option("MiaPaCa2 cell lines: resistance vs sensitivity to Methotrexate","Mia_RvsS");
comp[5]=new Option("Normal Pancreas: adjacent to PDAC (subgroup 1) vs Healthy donor","NAD1vsND");
comp[6]=new Option("Normal Pancreas: adjacent to PDAC (subgroup 2) vs Healthy donor","NAD2vsND");
comp[7]=new Option("Normal Pancreas: adjacent to PDAC (subgroup 3) vs Healthy donor","NAD3vsND");
comp[8]=new Option("Pancreatic Adenocarcinoma (PDAC) vs Healthy donor","PDACvsND");
comp[9]=new Option("Patu8988T vs Patu8988S: Sensitivity vs resistance to oncolytic adenoviruses","Patu_SvsI");
comp[10]=new Option("Ectopic Xenograft human pancreatic tumour:Effect of SMO-acting antagonist of Hh pathway treatment vs controls","X_HhvsV");
comp[11]=new Option("Ectopic Xenograft human pancreatic tumour:Sensitivity vs resistance to EGFR inhibitors erlotinib and cetuximab","X_SvsR");
comp[12]=new Option("Ectopic Xenograft from human pancreatic tumour:Treated vs untreated with Hsp 90 Inhibitor (IPI-504)","X_trvsuntr");
comp[13]=new Option("YPAC cell lines vs other pancreatic cancer cell lines","YPAC");

var temp=document.landscapeform.compType;
for (i=0;i<comp.length;i++){
temp.options[i]=new Option(comp[i].text,comp[i].value);
}
temp.options[0].selected=true;

}

